Mongodb regex not matching exact when . (dot) in search<p>I want to check if email already registered in my MongoDB database or not.<br>
I have one user registered with <code>test123@test.com</code><br>
But If I check for <code>test.23@test.com</code> it still matches record of <code>test123@test.com</code>  <br>
I tried following queries<br></p>

<pre><code>db.getCollection('users').find(
     {"email":{ $regex: new RegExp(test.23@test.com, "i") } 
})

db.getCollection('users').find(
         {"email":{ $regex: new RegExp(/test.23@test.com/, "i") } 
})

db.getCollection('users').find(
         {"email":{ $regex: new RegExp(/^(test.23@test.com)$/, "i") } 
})

db.getCollection('users').find(
         {"email":{ $regex: new RegExp(/^(test.23@test\.com)$/, "i") } 
})
</code></pre>

<p>How can I search exact match with case insensitive?</p>

