MongoDB multiple counts, single document, arrays<p>I have been searching on stackoverflow and cannot find exactly what I am looking for and hope someone can help.  I want to submit a single query, get multiple counts back, for a single document, based on array of that document.</p>

<p>My data:</p>

<pre><code>db.myCollection.InsertOne({
  "_id": "1",
  "age": 30,
  "items": [
    {
      "id": "1",
      "isSuccessful": true,
      "name": null
    },{
      "id": "2",
      "isSuccessful": true,
      "name": null
    },{
      "id": "3",
      "isSuccessful": true,
      "name": "Bob"
    },{
      "id": "4",
      "isSuccessful": null,
      "name": "Todd"
    }
  ]
});

db.myCollection.InsertOne({
  "_id": "2",
  "age": 22,
  "items": [
    {
      "id": "6",
      "isSuccessful": true,
      "name": "Jeff"
    }
  ]
});
</code></pre>

<p>What I need back is the document and the counts associated to the items array for said document.  In this example where the document _id = "1":</p>

<pre><code>{
  "_id": "1", 
  "age": 30,
  {
    "totalIsSuccessful" : 2,
    "totalNotIsSuccessful": 1,
    "totalSuccessfulNull": 1,
    "totalNameNull": 2
  }
}
</code></pre>

<p>I have found that I can get this in 4 queries using something like this below, but I would really like it to be one query.</p>

<pre><code>db.test1.aggregate([
  { $match : { _id : "1" } },
  { "$project": {
    "total": {
      "$size": {
        "$filter": {
          "input": "$items",
          "cond": { "$eq": [ "$$this.isSuccessful", true ] }
        }
      }
    }
  }}
])
</code></pre>

<p>Thanks in advance.</p>

