Mongoose: Using objectModel.schema doesn't work for parameter in other schema?<p>With mongoose, if you define two Schemas:</p>

<pre><code>const mongoose = require("mongoose");

const objectAModel = require("/pathTo/objectAModel");

const Schema = mongoose.Schema;

const objectBSchema = new Schema({
  _id: Schema.Types.ObjectId,
  objectAArray: [objectAModel.Schema]
});

module.exports = mongoose.model("objectB", objectBSchema);
</code></pre>

<pre><code>const mongoose = require("mongoose");

const objectBModel = require("/pathTo/objectBModel");

const Schema = mongoose.Schema;

const objectASchema = new Schema({
  _id: Schema.Types.ObjectId,
  objectBArray: [objectBModel.Schema]
});

module.exports = mongoose.model("objectB", objectBSchema);
</code></pre>

<p>The first code works fine, but the second one throws an error:</p>

<pre><code>TypeError: Invalid value for schema Array path `ObjectBArray`
</code></pre>

<p>So, I can't identify the problem, since both of the code snippets are the same, and if I delete the .schema from the objectBArray in the second snippet, everythin works. What's the problem?</p>

