Promise.all() returns undefined array of Promise <Pending>'s, despite similar solutions returning successful alternatives<p>I'm building a web app that allows users to view a dashboard of items, which in turn have individual sections (a, b, and c), which the dashboard will show as complete (o) or incomplete (x) as illustrated below. This allows the user to navigate directly to the page that has missing information, as all of an item's information is required to progress to the next stage.</p>

<pre><code>Item | a | b | c | Next Stage?
------------------------------
abc  | x | o | x | No
def  | x | x | x | No
ghi  | o | o | o | Yes
</code></pre>

<p>Within each item (e.g. abc), it can have a number of sub-items which must all be completed for that item's a, b, or c section to be marked as complete. This has been achieved through a nested series of promises that update a 'completeness' variable whenever a sub-item is updated. However, <strong>the issue</strong> arises when attempting to transport the variable from the scope of sub-items (a's, b's, c's) to parent items (abc, def, ghi). I've previously used nested promises without implementation of async/await and as this is the final usage of a promise within the scope of this project, I'm hesitant to adopt a different way of solving this problem (but I'm not against it).</p>

<p><strong>Current Implementation:</strong></p>

<pre><code>exports.loadDashboard = (req, res, next) =&gt; {
Item.find()
.where("user").equals(req.session.user)
.select()
.exec()
.then(docs =&gt; {
    const response = {
        items: docs.map(doc =&gt; {
            const aPromise = Feature.find().where("projectID").equals(doc._id).select("aComplete").exec();
            const bPromise = Feature.find().where("projectID").equals(doc._id).select("bComplete").exec();
            const cPromise = Feature.find().where("projectID").equals(doc._id).select("cComplete").exec();
            Promise.all([aPromise, bPromise, cPromise]).then(result =&gt; {
                return{
                    _id: doc._id,
                    user: doc.user,
                    aComplete: result[0],
                    bComplete: result[1],
                    cComplete: result[2]
                }
            // })
        }
    ),
    userSessionID: req.session.user   
    }
    if(req.session.user != null){
        console.log(response);
        res.render("dashboard", {response});
    }else{
        res.redirect("login");
    }
})
.catch(err=&gt;{
    console.log(err);
    res.status(500).json({
        error: err
    });
});
</code></pre>

<p>}</p>

<p>...which grants a <code>response</code> of:</p>

<pre><code>{  items: [ undefined, undefined, undefined ],
 userSessionID: '1' }
</code></pre>

<p>These undefined items are of type <code>Promise &lt;Pending&gt;</code>, and similar issues have been solved in similar manners, but this time I'm quite stuck. My question is, is it possible to solve this without delving into async/await, or should I bite the bullet, and if that's the case I'd be most grateful for any assistance provided.</p>

<p>Thanks for reading</p>

