MongoDB how to find documents with undefined $lookups (aggregation)<p>I have a document in an origin collection that holds OR not holds a reference to a foreign collection document - The key is not mandatory, so sometimes it's missing.</p>

<p>In such a situation the $lookup is "failed" and the desired document is not getting fetched from the DB.</p>

<p>This is the pipeline:</p>

<pre><code>{
    $lookup: {
      from: "tables",
      let: { "enginefuel_type": "$engine.fuel_type" },
      pipeline: [
        { $match: { $expr: { $eq: ["$_id", "$$enginefuel_type"] }}},
        { $project: { title: 1 }}
      ],
      as: "engine.fuel_type"
    }
  },
  {
    $unwind: "$engine.fuel_type"
  },

  {
    $lookup: {
      from: "tables",
      let: { "enginegear": "$engine.gear" },
      pipeline: [
        { $match: { $expr: { $eq: ["$_id", "$$enginegear"] }}},
        { $project: { title: 1 }}
      ],
      as: "engine.gear"
    }
  },
  {
    $unwind: "$engine.gear"
  }
</code></pre>

<p>I need the document to be found anyway - whether it has the <strong>engine.fuel_type</strong> and/or <strong>engine.gear</strong> fields or not.
If there is, so it should take the document from the foreign, otherwise just remain empty but not ignore the whole document.</p>

<p>I thought about making some pre-if statement checking if the field exists before making the aggregate query (could also be more efficient, reducing requests to the DB).</p>

<p>Is there any good way to do that?</p>

